  false,\n\t\"url\": null,\n\t\"notes\": \"Comprehensive report on the development
  of the Cornell Dam, located on the Niobrara River in Valentine, Nebraska.    This
  dam is located near the confluence of the Niobrara River and the  Minnechaduza River,
